import React, { Component } from 'react'
import axios from 'axios'


export default class Articulos extends Component {

    

    state={
        articulos: []
      }

    GenerateArticles(props)
    {
        return(
            <React.Fragment>
                <Articulo/>
            </React.Fragment>
    
        )
    }

    componentWillMount()
    {
        axios.get('https://api.myjson.com/bins/s80td')
        .then(res=>this.setState({articulos:res.data}))
    }

    render() {
        const {id,titulo,descripcion,image}=this.state.articulos;
        return this.state.articulos.map((articulo)=>(
            <Articulo key={articulo.id} articulo={articulo} ver={this.props.markComplete}/>
          ))
    }
}
